import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int n = input.nextInt();
        long l = input.nextLong();
        long can = 0, sum = 0;
        long[] a = new long[n];
        for (int i = 0; i < n; ++i) {
            a[i] = input.nextLong();
        }
        for (int i = 0; i < n; ++i) {
            for (int j = i + 1; j < n; ++j) {
                if (a[i] + a[j] > l) {
                    ++can;
                }
                ++sum;
            }
        }
        System.out.printf("%.2f", 1.0 * can / sum);
    }
}

