import java.util.Scanner;
public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int n = input.nextInt();
        int k = input.nextInt();
        int m = input.nextInt();
        k++;
        int[] f = new int[n+1];
        f[1] = 0;
        for(int i=2;i<=n;i++)
            f[i] = (f[i-1] + k) % i;
        int t = (m - f[n] + k - 1) % n;
        if(t <= 0)
            t += n;
        t -= 1;
        t -= k;
        t += 1;
        t %= n;
        t = (t + n) % n;
        System.out.println(t+1);
    }
}

