import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int t = input.nextInt();
        double[][] a = new double[t][2];
        for (int i = 0; i < t; i++) {
            a[i][0] = input.nextDouble();
            a[i][1] = input.nextDouble();
        }
        for (int i = 0; i < t; i++) {
            if (a[i][0] <= 2 * a[i][1]) {
                System.out.println("1.000000");
                System.out.println("YES");
            } else {
                System.out.printf("%.6f\nYES\n", (a[i][1] * a[i][1]) / ((a[i][1] - a[i][0]) * (a[i][1] - a[i][0])));
            }
        }
    }
}

