import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int[] a = new int[10001];
        double ans = 0.0;
        for (int i = 1; i <= n; i++) {
            a[i] = scanner.nextInt();
        }
        Arrays.sort(a, 1, n+1);
        for (int i = 2; i <= n-1; i++) {
            ans += a[i];
        }
        System.out.printf("%.2f", ans/(n-2));
    }
}

