public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int x = input.nextInt();
        int y = input.nextInt();
        int p = input.nextInt();
        double pp = (double) p / 1000.0;
        pp = 1.0 - pp;
        double ans = 0;
        for (int i = 1; i <= x - 1; i++) {
            ans += 1.0 * i * ksm(pp, i - 1) * (1.0 - pp);
        }
        ans += 0.5 * x * ksm(pp, x - 1);
        for (int i = x + 1; i <= y - 1; i++) {
            ans += 0.5 * i * ksm(pp, i - 2) * (1.0 - pp);
        }
        ans += 0.5 * y * ksm(pp, y - 2);
        System.out.printf("%.3f\n", ans);
    }

    public static double ksm(double a, int k) {
        double ret = 1.0;
        while (k != 0) {
            if ((k & 1) != 0) {
                ret *= a;
            }
            a *= a;
            k >>= 1;
        }
        return ret;
    }
}

