public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int k = sc.nextInt();
        int[] a = new int[100010];
        for (int i = 1; i <= n; i++) {
            a[i] = sc.nextInt();
        }
        while (k > 0) {
            int c = sc.nextInt();
            int index = lowerBound(a, c);
            System.out.println(index);
            k--;
        }
    }

    private static int lowerBound(int[] a, int target) {
        int left = 1;
        int right = a.length - 1;
        while (left < right) {
            int mid = (left + right) / 2;
            if (a[mid] >= target) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        return left;
    }
}

