import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int n = input.nextInt();
        int[][] a = new int[320][160];
        for (int i = 0; i < n; i++) {
            a[0][i] = input.nextInt();
        }
        for (int _ = 1; _ < n; _++) {
            for (int i = 0; i < n; i++) {
                a[_][i] = a[0][(i + _) % n];
            }
        }
        for (int i = 0; i < n; i++) {
            a[n][i] = a[0][n - 1 - i];
        }
        for (int _ = 1; _ < n; _++) {
            for (int i = 0; i < n; i++) {
                a[_ + n][i] = a[n][(i + _) % n];
            }
        }
        int ans = 1;
        for (int _ = 1; _ < n + n; _++) {
            boolean diff = true;
            for (int __ = 0; __ < _ && diff; __++) {
                boolean same = true;
                for (int i = 0; i < n && same; i++) {
                    if (a[_][i] != a[__][i]) same = false;
                }
                if (same) diff = false;
            }
            if (diff) ++ans;
        }
        System.out.println(ans);
    }
}

